let error = {
    token(err) {
        return {
            type: 'token',
            message: err
        };
    },
    clientToken(err) {
        return {
            type: 'clientToken',
            message: err
        };
    },
    code(err){
        return {
            type:'code',
            message:err
        };
    },
    action(err){
        return {
            type:'action',
            message:err
        };
    }
};


export default error;

